import './App.scss';
import logo from './logo.png';
import avatar from './avatar.png';
import plus from './plus.png';
import CustomWebcam from './CustomWebcam';

function App() {
  return (
    <div className="App">
      <div className='header'>
          <img src={logo} alt="logo" width="130px" />
        </div>
      {false && <div className='name-comp'>
        <div className='avatar'>
          <img src={avatar} alt="avatar" width="180px" />
        </div>
        <div className='name'>
          <input placeholder="Masukkan nama Anda" />
        </div>
        <div className='btn-cta'>
          <button>mulai</button>
        </div>
      </div>}

      {false && <div className='home-comp'>
        <div className='plus'>
          <img src={plus} alt="plus" width="180px" />
        </div>
        <div className='label-text'>Klik gambar</div>
      </div>}

      {false && <div className='webcam'>
        <CustomWebcam />
      </div>}

      <div className='crop'>
        <div className='label'>Select Crop</div>
        <div className='crop'>Chili</div>
        <div className='crop'>Rice</div>
        <div className='crop'>Corn</div>
      </div>
    </div>
  );
}

export default App;
